%2.1.4. характеристики по пп. 2.1.1-2.1.2 по отдельным частям выборки
res = fopen('result.txt', 'w');
for i = 1:10
    fprintf (res,'среднее арифметическое для выборки № %i\n\n',i);
    sr = mean(matrix(i,:));
    mmean(i)=sr;%массив для хранения средних арифметических
    fprintf(res,num2str(sr));
    fprintf(res,'\n');
    
    fprintf (res,'медиана для выборки № %i\n',i);
    sd = median(matrix(i,:));
    mmedian(i)=sd;%массив для хранения медиан для выборки
    fprintf(res,num2str(sd));
    fprintf(res,'\n');
    
    fprintf (res,'средина размаха для выборки № %i\n',i);
    sd = range(matrix(i,:))/2;
    mrange(i)=sd;%массив для хранения средин размаха для выборок
    fprintf(res,num2str(sd));
    fprintf(res,'\n');
    
    fprintf (res,'дисперсия № %i\n',i);
    sd = moment(matrix(i,:),2);
    mmoment(i)=sd; %массив для хранения значений дисперсий
    fprintf(res,num2str(sd));
    fprintf(res,'\n');
    
    fprintf (res,'ско для выборки № %i\n',i);
    sd = std(matrix(i,:));
    msd(i)=sd;%массив для хранения значений ско
    fprintf(res,num2str(sd));
    fprintf(res,'\n');
    
    fprintf (res,'третий центральный момент для выборки № %i\n',i);
    sd = moment(matrix(i,:),3);
    mmomentthree(i)=sd;%массив для хранения значений 3-х центральных моментов
    fprintf(res,num2str(sd));
    fprintf(res,'\n');
    
    fprintf (res,'четвертый центральный момент № %i\n',i);
