skoocenka = sqrt(1/499*sum((matrix(i,:)-sr).^2));
dispocenka = 1/499*sum((matrix(i,:)-sr).^2);
left = sr - skoocenka/sqrt(500)*tinv(0.9,499);
right = sr + skoocenka/sqrt(500)*tinv(0.9,499);
fprintf(res,'интервальные оценки для матожидания\n');
matleft(i)=left;
matright(i)=right;
